- (void)finishing:(NSString *)updateStr {

    NSData *targetData = [self HexStringToData:updateStr];
    [MTOTAManager startOTAUpdate:_per.connector UpdateType:StencilUpdate OTAData:targetData progressHandler:^(float a) {
        NSLog(@"------>%f",a);
        if (a == 1) {
            dispatch_after(dispatch_time(DISPATCH_TIME_NOW, (int64_t)(1 * NSEC_PER_SEC)), dispatch_get_main_queue(), ^{
                self->lable.text = @"finished";
                [self->manager disconnectFromPeriperal:self->_per];
            });
        }
    }];
    
}

- (NSMutableData*)HexStringToData:(NSString*)str
{
    NSString *command = str;
    command = [command stringByReplacingOccurrencesOfString:@" " withString:@""];
    NSMutableData *commandToSend= [[NSMutableData alloc] init];
    unsigned char whole_byte;
    char byte_chars[3] = {'\0','\0','\0'};
    int i;
    for (i=0; i < [command length]/2; i++) {
        byte_chars[0] = [command characterAtIndex:i*2];
        byte_chars[1] = [command characterAtIndex:i*2+1];
        whole_byte = strtol(byte_chars, NULL, 16);
        [commandToSend appendBytes:&whole_byte length:1];
    }
    return commandToSend;
}

@end
